				else {
					Cards Bought = Deck.getActionDeck().get(rand).remove(0);
					if (Bought.getCost() != 0)
						p1.PayPiper(Bought.getCost());
					p1.get_PlayHand().add(Bought);
					Bought_Card = true;
				}
			
			}while(Bought_Card == false);
			Bought_Card = false;
			safe = false;
		}
		p1.Player_Buy_Turns = 1;
